CREATE TABLE trees_all (
    `trees_key` VARCHAR(8) CHARACTER SET utf8,
    `trees_properties_species` VARCHAR(9) CHARACTER SET utf8,
    `trees_properties_variety` VARCHAR(17) CHARACTER SET utf8,
    `trees_properties_section` INT,
    `trees_properties_row` INT,
    `trees_properties_location_lng` NUMERIC(12, 9),
    `trees_properties_location_lat` NUMERIC(12, 10),
    `trees_properties_date_planted` VARCHAR(10) CHARACTER SET utf8,
    `trees_properties_icon` VARCHAR(12) CHARACTER SET utf8,
    `trees_properties_notes` VARCHAR(111) CHARACTER SET utf8
);
